import styled from 'styled-components';

const Container = styled.div``;

const BackDrop = styled.div`
	position: absolute;
	top: 0;
	bottom: 0;
	width: 100%;
	z-index: 3;
	overflow: hidden;
	background-color: rgba(0, 0, 0, 0.4);
`;

const Content = styled.span`
	position: absolute;
`;

export { Container, Content, BackDrop };
